import React from 'react';

const Example = () => {
  return (
    <>
      <style>
        {`
          .container {
            display: flex;
            justify-content: space-between;
          }

          .image-container {
            width: 40%;
          }

          .text-container {
            width: 50%;
            text-align: center;
          }


          .content {
            text-align: center;
            margin: 0 auto; /* Center the div */
            max-width: 600px; /* Optional: Limit the width of the content */
          }

          hr {
            border: none;
            height: 10px; /* Adjust thickness as needed */
            background-color: red; /* Set color to red */
            margin-bottom: 50px;
          }

          img {
            border-radius: 20%;
            max-width: 100%;
            height: auto;
          }

          h1 {
            color: white; /* Added to make text white */
            width: 100%;
            margin-top: 20px;
            text-align: center;
          }
          h2, p {
            color: white; /* Added to make text white */
          }

          @media screen and (max-width: 768px) {
            .container {
              flex-direction: column;
            }

            .image-container {
              width: 100%;
              text-align: center;
            }

            .text-container {
              width: 100%;
              margin-top: 20px;
              text-align: center;


              .container2 {
                display: flex;
                justify-content: center;
                align-items: center;
                text-align: center;
              }

              .text-container2 {
                flex: 1;
              }

              .image-container2 {
                flex: 1;
              }

              .image-container2 img {
                max-width: 100%;
              }

              @media (max-width: 768px) {
                .container2 {
                  flex-direction: column;
                }
              }

            }
          }
        `}
      </style>

      <div>

      <div className="content">
            <h1>TRAINING</h1>
            <p>
              Our certified personal trainers create the perfect programs to help you reach your goals, designed 100% around you. And they’ll be cheering you on when you cross that finish line like a badass, too.
            </p>
          </div>
      </div>
      <hr></hr>

      <div className="container">
        <div className="image-container">
          <img src='https://tinyurl.com/vhj5skyz' alt='Fitness' />
        </div>
        <div className="text-container">
          <h2>OUR MISSION</h2>
          <p>
            Here at AL Fitness, we focus on bringing you the most powerful workouts to meet your needs: our toolbox includes weighted battle ropes, kettlebells, TRX® suspension straps, MMA equipment, Bulgarian Bags, and the list goes on.

            It may sound like a mouthful, but this world-class functional training equipment helps our trainers provide you with an array of High Intensity Interval Training (HIIT) workouts.

            Our Crunch Fitness locations offer HIITZone, an all-encompassing fitness program including personal training, small group training, and nutrition.

            Let’s make a lunge date!
          </p>
        </div>
      </div>
      <div class="container2">
  <div class="text-container2">
    <h2>OUR MISSION</h2>
    <p>
      Here at AL Fitness, we focus on bringing you the most powerful workouts to meet your needs: our toolbox includes weighted battle ropes, kettlebells, TRX® suspension straps, MMA equipment, Bulgarian Bags, and the list goes on. It may sound like a mouthful, but this world-class functional training equipment helps our trainers provide you with an array of High Intensity Interval Training (HIIT) workouts. Our Crunch Fitness locations offer HIITZone, an all-encompassing fitness program including personal training, small group training, and nutrition. Let’s make a lunge date!
    </p>
  </div>
  <div class="image-container2">
    <img src='https://tinyurl.com/vhj5skyz' alt='Fitness' />
  </div>
</div>

    </>
  );
}

export default Example;
